import "./SignUp.css"

const SignUp = () =>{
    useEffect(() =>{
        fetch("localhost:8080/sign-up")
            .then((res)=>{
                return res.json()
            })
            .then(data =>{
                console.log(data)
            })
    }, [])


    return(
        <div className="signup">
            <h1>Sign Up</h1>
            <form method="post" action="http://localhost:8080/sign-up">
                <input type="text" name="username" placeholder = "Username" className="input-username" />
                <input type="password" name="password" placeholder = "Password" className="input-password" />
                <button type="submit">Sign Up</button>
            </form>
        </div>
    )
}

export default SignUp;
